<style type="text/css">

#pagebody {height:0;}
#pagebody table {
border-collapse:collapse;
}

body{
	font-family: "メイリオ", Meiryo, "游ゴシック", YuGothic, "ヒラギノ角ゴ ProN W3", "Hiragino Kaku Gothic ProN", sans-serif;
}

a:link { color:#2e2e2e; text-decoration:none; }
a:visited { color:#2e2e2e; }
a:active { color:#2e2e2e; }
a:hover { color:#2e2e2e; text-decoration:underline; }


/*販売実績*/
.results {
	color:#2e2e2e;
	font-size:20px;
	font-weight:bold;
	letter-spacing:0.5em;
	margin-bottom:50px;
}

.thanks{
	font-size:15px;
}

span.results_number{
	font-size:60px;
}


/*商品名周り*/
td.sdtext{
	font-size: 70%;
}	

span.catch_copy{
    line-height: 1.5em;
    display: block;
    font-size: 60%;
}

span.item_name {
    line-height: 1.5em;
    font-size: 75%;
}

strong, b {
	font-weight: normal;
}

span.inventory_choice_name {
    font-size: 80%;
}

td.inventory_choice_name {
    white-space: normal;
    padding-right: 2px;
    padding-left: 2px;
    padding-bottom: 2px;
    padding-top: 2px;
    margin: 0px;
}

span.inventory_desc {
display: block;
padding: 10px 0px;
}



/*カラーサイズ表*/
span.inventory_choice_name {
	font-size: 80%;
}

#rakutenLimitedId_aroundCart td.inventory {
	padding:3px!important;
}
.inventory font{
	font-size:10px;
	color: #999999;
}

span.item_desc{
    font-size: 80%;
    margin-top: 20px;
    display: block;
}

span.sale_desc img{
    width: 770px;
    display: block;
}


/*項目選択肢*/
span.choice {
	/*margin-top:20px;
	width:500px;
	padding:10px;
	border:1px solid #333;
	font-weight:bold;*/
	font-size: 12px;
}
span.choice + select {
	padding: 3px;
	border: 1px solid #ccc;
	font-weight: bold !important;
}
#rakutenLimitedId_aroundCart span.choice {
	display: block;
	margin-bottom: 5px;
}



/*お問い合わせボタン*/
font input {
	background:#fcfcfc 10px 5px 10px 0;
	background-image:none;
	margin-bottom:5px;
	padding:5px;
}

/*IE対応*/
*html font input {
	background:#fcfcfc no-repeat 9px 8px;
	margin-bottom:6px;
}

/*カゴ上送料説明バナー*/
span.unit {
	background:url(http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/pc_souryou.gif) no-repeat left top;
	text-indent:-9999; display: block; width: 210; height: 60; margin-top:5px; margin-bottom:0px;
	color:#FFFFFF;
}


</style>
<!--　カートデザイン end -->

